create database storeLocation;
use storeLocation;

create table store_location(
    id int not null auto_increment,
    title varchar(100) not null,
    address varchar(100) not null,
    lat DOUBLE not null,
    lon DOUBLE not null,
    primary key (id)
);

create table us_zip(
    id int not null auto_increment,
    zip varchar(5) not null,
    lat DOUBLE not null,
    lon DOUBLE not null,
    primary key (id)
);


